import React,{useState} from 'react';
import { TouchableOpacity } from 'react-native-web';
import { NativeBaseProvider, Text, Box , extendTheme, Button} from 'native-base';
import inputButton from './src/components/inputButton';


const buttons =  [
  ['CLEAR', 'DEL'],
  ["7", "8" ,"9", '/'],
  ["4", "5", "6", "x"],
  ["1", "2", "3", "-"],
  ["0", ".", "=", "+"]
];
export default function App() {
  const [count, setCount] = useState(0);

  return (
    <NativeBaseProvider>
      <Box flex={1} bg="#fff" alignItems="center" justifyContent="center">
        <Text>Click this button to increase the value</Text>
        <Text>{count}</Text>
        <Button onPress={()=>setCount(count + 1)}>counting</Button>
        <TouchableOpacity
        onPress={()=>setCount(count + 1)}
        >
        <Text>press me</Text>
        </TouchableOpacity>
      </Box>
    </NativeBaseProvider>
  );
}
